&quot;I have done a great deal of work in this field and felt the book made an archaic subject readable and exciting for the non-specialist and scholar. The text made the subject matter accessible to a wide range of readers, but with a solid historical context. The photography was exceptionally good and clearly showed the detail of ancient artifacts and hard to find black-and-white excavation photographs from the early 20th century. Overall I was surprised by how much I enjoyed the book.&quot;

B.G. Brainard on Goodreads
